import {
    appbarHeight
} from '../../masterStyle.js';

const goldenRatio = 1.61803398875;

const dashboardStyle = theme => ({
    container: {
        height: "100%",
        marginTop: "2rem",
        [theme.breakpoints.up('sm')]: {
            marginTop: appbarHeight,
            marginLeft: theme.spacing(2)
        }
    },
    title: {
        padding: "1.5rem"
    },
    section: {
        marginLeft: "16px",
        marginRight: "16px",
        [theme.breakpoints.up("sm")]: {
            marginLeft: "24px",
            marginRight: "24px",
            width: "85%"
        }
    },
    square: {
        [theme.breakpoints.up("sm")]: {
            flex: goldenRatio,
            marginBottom: "3rem"
        }
    }
});

export default dashboardStyle;
